import { createApp } from "vue";
import "./style.scss";
import App from "./App.vue";

createApp(App, {
  data() {
    return {
      hLink:
        "https://www.themoviedb.org/movie/634649-spider-man-no-way-home?language=en-CA",
    };
  },
}).mount("#app");
